INSERT INTO `doctor_info` VALUES (1, '王小明', '1', '1980-07-15', '主治医师', 1, 1, '毕业于北京协和医学院,从事内科工作20余年,擅长诊治各种常见内科疾病,尤其在糖尿病、高血压等慢性病方面经验丰富,被评为国家级名中医。张医生为人亲和,耐心细致,深受广大患者的好评', '1', 'data:image/jpeg;base64,', 5, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (2, '张丽丽', '2', '1982-05-23', '副主任医师', 2, 2, '毕业于上海交通大学医学院,长期从事心血管内科工作,擅长冠心病、心力衰竭等疾病的诊治。李医生医术精湛,曾多次获得医院年度优秀医生称号,在业内享有很高声誉', '1', 'data:image/jpeg;base64,', 4, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (3, '李华', '1', '1976-09-10', '主任医师', 3, 3, '毕业于华西医科大学,从事儿科工作近15年,尤其擅长新生儿疾病的诊治。王医生热爱职业,耐心细致,深受小患者及家长的好评', '1', 'data:image/jpeg;base64,', 2, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (4, '刘强', '1', '1988-03-28', '住院医师', 4, 4, '毕业于北京大学医学部,从事外科工作30余年,是国内知名的胃癌专家。赵医生医术精湛,曾多次主持国家重大科研项目,并在国际权威期刊发表多篇论文,是业内公认的权威', '1', 'data:image/jpeg;base64,', 3, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (5, '陈小红', '2', '1985-11-04', '副主治医师', 5, 5, '毕业于复旦大学,从事妇产科工作近10年。钱医生技术过硬,服务态度热情,深受产妇的好评', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (6, '张伟', '1', '1979-12-19', '主任医师', 1, 1, '毕业于中山大学,从事骨科工作多年,擅长各类骨折、关节置换等手术。孙医生手术经验丰富,多次获得医院年度优秀医生称号', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (7, '王芳', '2', '1983-08-25', '副主任医师', 2, 2, '毕业于四川大学,是国内知名的肿瘤专家,长期从事肿瘤的临床诊治工作。周医生学术造诣深厚,多次在国内外重要学术会议上做主旨报告', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (8, '李明', '1', '1974-06-12', '主治医师', 3, 3, '是新晋住院医师,毕业于复旦大学。吴医生刻苦学习,勤奋好学,医患沟通能力强,备受好评', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (9, '赵静', '2', '1980-04-07', '住院医师', 4, 4, '毕业于中国医科大学,从事眼科工作多年,尤其擅长白内障、青光眼等疾病的手术治疗。郑医生为人勤恳,技术过硬,深受患者信赖', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
INSERT INTO `doctor_info` VALUES (10, '王浩', '1', '1986-01-30', '副主治医师', 5, 5, '毕业于南京医科大学,从事耳鼻喉科工作近10年。汪医生热爱工作,耐心细致,深受患者好评', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
