INSERT INTO `doctor_info` VALUES (12, '陈伟', '1', '1981-02-19', '主任医师', 2, 3, '毕业于上海交通大学医学院,长期从事心血管内科工作,擅长冠心病、心力衰竭等疾病的诊治。李医生医术精湛,曾多次获得医院年度优秀医生称号,在业内享有很高声誉', '1', 'data:image/jpeg;base64,', NULL, '2024-04-15 16:43:46');
