INSERT INTO `post` VALUES (1, 1, '不要乱吃药！儿童用药的7个原则，避免造成严重后果！', '儿童是一个特殊群体，由于其正处在身体生长发育的重要时期，各脏器均未完全发育成熟，肝脏的解毒功能较差', '儿童是一个特殊群体，由于其正处在身体生长发育的重要时期，各脏器均未完全发育成熟，肝脏的解毒功能较差,因此儿童在用药方面就应该较成年人更为谨慎。\n即便是不同年龄阶段的儿童 , 也存在差距。但由于目前市面上儿童用药缺少安全性资料、药品种类少、合适剂型也少，导致了很多的儿童不合理用药。01疾病诊断要准确\n                                                                    \n                                                                    \n                                                                    药物治疗之前应尽可能明确诊断，只有明确诊断才能对症下药，才能保证药物选择的准确性，这是药物治疗的前提。\n                                                                    \n                                                                    \n                                                                    02用药时机需把握\n                                                                    \n                                                                    \n                                                                    能不用药尽量不用药。\n                                                                    孩子一旦有点不适，很多家长就会急着给孩子服药。\n                                                                    其实应该先观察孩子的状态，比如感冒引起的发热，一般不超过38.5℃，孩子精神尚可，家长可以先在家中用酒精擦拭身体或用冰袋物流降温，多喝水多排尿。', '2024-04-16 00:29:06');
INSERT INTO `post` VALUES (2, 2, '不要乱吃药！儿童用药的7个原则，避免造成严重后果！', '儿童是一个特殊群体，由于其正处在身体生长发育的重要时期，各脏器均未完全发育成熟，肝脏的解毒功能较差', '儿童是一个特殊群体，由于其正处在身体生长发育的重要时期，各脏器均未完全发育成熟，肝脏的解毒功能较差,因此儿童在用药方面就应该较成年人更为谨慎。\n即便是不同年龄阶段的儿童 , 也存在差距。但由于目前市面上儿童用药缺少安全性资料、药品种类少、合适剂型也少，导致了很多的儿童不合理用药。01疾病诊断要准确\n                                                                    \n                                                                    \n                                                                    药物治疗之前应尽可能明确诊断，只有明确诊断才能对症下药，才能保证药物选择的准确性，这是药物治疗的前提。\n                                                                    \n                                                                    \n                                                                    02用药时机需把握\n                                                                    \n                                                                    \n                                                                    能不用药尽量不用药。\n                                                                    孩子一旦有点不适，很多家长就会急着给孩子服药。\n                                                                    其实应该先观察孩子的状态，比如感冒引起的发热，一般不超过38.5℃，孩子精神尚可，家长可以先在家中用酒精擦拭身体或用冰袋物流降温，多喝水多排尿。', '2024-04-24 19:56:26');
